import React from "react";

function About() {
  return (
    <div id="about-section" className="section">
      <h4>About</h4>
      <p>
        In my many years of experience with mathematics, teaching, and
        programming, I have mastered the arts of problem-solving, analytical
        thinking, clear and concise communication, and attention to detail.
        During my time working with incarcerated individuals, I have developed a
        heart for finding innovative ways to serve the underserved. I am eagerly
        seeking opportunities to use these skills and passions to serve others
        by creating effective, efficient, and creative code solutions.{" "}
      </p>
      <p>
        Outside of teaching and programming, I am <em>always</em> learning new
        things. From studying new languages (Currently pursuing Spanish, as well
        as Hindi and Chinese) to studying the Bible, from teaching myself new
        skills (most recently, rollerblading) to learning more about the people
        and world around me, I have never stopped and will never stop learning
        and pursuing deeper understandings of life, the universe, and all the
        people in it.{" "}
      </p>
    </div>
  );
}

export default About;
